import React from 'react';
import styles from './Layout.module.scss';
import { Link } from 'react-router-dom';
const Header = () => {
	return (
		<header className={styles.header}>
			<ul>
				<Link></Link>
				<Link></Link>
			</ul>
		</header>
	);
};

export default Header;
